import * as S from './styled';

function App() {
  return (
    <div>
      <div style={{ display: 'flex' }}></div>
      <div className='background'>
        <S.Line style={{ paddingTop: '10px' }} />
        <S.Line style={{ marginTop: '8px' }} />
        <S.Line style={{ marginTop: '8px' }} />
        <S.Line style={{ marginTop: '20px' }} />
        <S.Line style={{ marginTop: '25px' }} />
        <S.Line style={{ display: 'flex', flexDirection: 'column', paddingLeft: '50px' }} />
      </div>
    </div>
  );
}

export default App;
